window.plugins["1523646823789x626489445406736400"] = {"human":"Text to Speech & Speech Recognition","dependencies":{"use_jquery":true},"plugin_elements":{"AAC":{"display":"Text to Speech","add_is_visible":true,"states":{"AAI":{"caption":"Available voices","name":"available_voices","value":"text","initialization_code":{"fn":"function(properties, context) {\n\n\n}"},"is_list":true},"AAK":{"caption":"Speech synthesis supported","name":"speech_synthesis_supported","value":"boolean","initialization_code":{"fn":"function() {\n  return \"speechSynthesis\" in window;\n}"}},"AAQ":{"caption":"Is speaking","name":"is_speaking","value":"boolean","initialization_code":{"fn":"function(properties, context) {\n\nreturn false;\n\n}"}},"AAR":{"caption":"Is paused","name":"is_paused","value":"boolean","initialization_code":{"fn":"function(properties, context) {\n\nreturn false;\n\n}"}},"AAS":{"caption":"Default voice","name":"default_voice","value":"text","initialization_code":{"fn":"function(properties, context) {\n\n\n\n}"}},"AAT":{"caption":"Available languages","name":"available_languages","value":"text","initialization_code":{"fn":"function(properties, context) {\n\n\n\n}"},"is_list":true},"AAU":{"caption":"Is Local Service","name":"is_local_service","value":"boolean","initialization_code":{"fn":"function(properties, context) {\n\n\n\n}"},"is_list":true}},"actions":{"AAD":{"caption":"Speak","code":{"fn":"function(instance, properties, context) {\n  window.utterances = [];\n  const msg = new SpeechSynthesisUtterance();\n  msg.text = properties.text;\n  msg.volume = properties.volume;\n  msg.rate = properties.rate;\n  msg.pitch = properties.pitch;\n\n  if (properties.voice) {\n    const selectedVoice = speechSynthesis.getVoices().find(voice => voice.voiceURI == properties.voice);\n\n    if (selectedVoice) {\n      msg.voiceURI = selectedVoice.voiceURI;\n      msg.lang = selectedVoice.lang;\n    } else {\n      console.log(\"speechSynthesis voiceURI '\" + properties.voice + \"' does not exist. Will use default voice.\");\n    }\n  } else if (properties.language && !properties.voice) {\n    const selectedVoice = speechSynthesis.getVoices().find(function (voice) {\n      return voice.lang.replace(/_/g, \"-\") == properties.language;\n    });\n\n    if (selectedVoice) {\n      msg.voiceURI = selectedVoice.voiceURI;\n      msg.lang = selectedVoice.lang;\n    } else {\n      console.log(\"speechSynthesis voice lang '\" + properties.language + \"' does not exist. Will use default voice.\");\n    }\n  }\n\n  window.utterances.push(msg);\n  window.speechSynthesis.speak(msg);\n\n  msg.onerror = function (event) {\n    console.log(\"An error has occurred with the speech synthesis: \" + event.error);\n  };\n\n  msg.onstart = function (event) {\n    instance.publishState(\"is_speaking\", true);\n  };\n\n  msg.onend = function (event) {\n    instance.publishState(\"is_speaking\", false);\n  };\n\n  msg.onpause = function (event) {\n    instance.publishState(\"is_speaking\", false);\n    instance.publishState(\"is_paused\", true);\n  };\n\n  msg.onresume = function (event) {\n    instance.publishState(\"is_speaking\", true);\n    instance.publishState(\"is_paused\", false);\n  };\n}"},"fields":{"AAE":{"caption":"Text","name":"text","editor":"DynamicValue","rank":0,"value":"text"},"AAF":{"caption":"Rate","name":"rate","editor":"DynamicValue","rank":1,"value":"number","default_val":1},"AAG":{"caption":"Volume","name":"volume","editor":"DynamicValue","rank":2,"value":"number","default_val":1},"AAH":{"caption":"Pitch","name":"pitch","editor":"DynamicValue","rank":3,"value":"number","default_val":1},"AAJ":{"caption":"Voice","name":"voice","editor":"DynamicValue","rank":4,"value":"text","optional":true},"AAc":{"caption":"OR Language","name":"language","editor":"DynamicValue","rank":5,"value":"text","optional":true}}},"AAL":{"caption":"Pause","code":{"fn":"function(instance, properties, context) {\n\n\n window.speechSynthesis.pause();\n\n\n}"}},"AAO":{"caption":"Resume","code":{"fn":"function(instance, properties, context) {\n\n\n window.speechSynthesis.resume();\n\n\n\n}"}},"AAP":{"caption":"Stop","code":{"fn":"function(instance, properties, context) {\n\n\n  window.speechSynthesis.cancel();\n\n\n\n}"}}},"code":{"initialize":{"fn":""},"update":{"fn":"function(instance, properties, context) {\n  window.speechSynthesis.cancel();\n  $(document).ready(function () {\n    function loadVoices() {\n      const voices = speechSynthesis.getVoices();\n      const voiceList = [];\n      const langList = [];\n      const localList = [];\n      voices.forEach(function (voice, i) {\n        voiceList.push(voice.voiceURI);\n        langList.push(voice.lang.replace(/_/g, \"-\"));\n        localList.push(voice.localService);\n        instance.publishState(\"available_voices\", voiceList);\n        instance.publishState(\"available_languages\", langList);\n        instance.publishState(\"is_local_service\", localList);\n\n        if (voice.default) {\n          instance.publishState(\"default_voice\", voice.voiceURI);\n        }\n      });\n    }\n\n    loadVoices();\n\n    window.speechSynthesis.onvoiceschanged = function () {\n      loadVoices();\n    };\n  });\n}"},"reset":{"fn":"function(instance, context) {\n\n\n\n}"}}},"AAe":{"display":"Speech Recognition","property_applications":{"resizable":false,"MinWidth":false},"add_is_visible":true,"fields":{"AAf":{"caption":"Language","name":"language","rank":0,"editor":"DynamicValue","value":"text","default_val":"en-US"},"AAm":{"caption":"Continuous recognition","name":"continuous","rank":1,"editor":"Checkbox","value":"boolean","default_val":true},"AAo":{"caption":"Keep full transcript","name":"keep_full_transcript","rank":2,"editor":"Checkbox","default_val":false},"AAq":{"caption":"Capitalize first word","name":"capitalize","rank":3,"editor":"Checkbox","default_val":false},"AAr":{"caption":"Period at end of sentence","name":"period","rank":4,"editor":"Checkbox","default_val":false}},"states":{"AAg":{"caption":"Transcript","name":"transcript","value":"text","initialization_code":{"fn":"function(properties, context) {\n\nreturn undefined;\n\n}"}},"AAh":{"caption":"Is Listening","name":"is_listening","value":"boolean","initialization_code":{"fn":"function(properties, context) {\n\nreturn false;\n\n}"}},"AAi":{"caption":"Sound Happening","name":"sound_happening","value":"boolean","initialization_code":{"fn":"function(properties, context) {\n\nreturn false;\n\n}"}},"AAl":{"caption":"Speech Recognition Supported","name":"speech_recognition_supported","value":"boolean","initialization_code":{"fn":"function() {\n  return \"webkitSpeechRecognition\" in window;\n}"}}},"events":{"AAn":{"caption":"Speech Recognized","name":"new_utterance"}},"actions":{"AAj":{"caption":"Start recognition","code":{"fn":"function(instance, properties, context) {\n  const {\n    isListening,\n    language,\n    recognition\n  } = instance.data;\n\n  if (isListening) {\n    return;\n  }\n\n  if (!recognition) {\n    context.reportDebugger(\"Couldn't start recognition. Not supported.\");\n    return;\n  }\n\n  if (language) {\n    recognition.lang = language;\n  }\n\n  recognition.start();\n\n  recognition.onresult = function (event) {\n    let final_transcript = \"\";\n    let interim_transcript = \"\";\n\n    for (let i = event.resultIndex; i < event.results.length; ++i) {\n      if (event.results[i].isFinal) {\n        let sentence = event.results[i][0].transcript.trim();\n\n        if (instance.data.capitalize && sentence) {\n          sentence = sentence.charAt(0).toUpperCase() + sentence.slice(1);\n        }\n\n        if (instance.data.period && sentence) {\n          sentence = sentence + \".\";\n        }\n\n        if (!instance.data.keepFull) {\n          final_transcript = sentence;\n        } else {\n          final_transcript = final_transcript.concat(sentence + \" \");\n        }\n      } else {\n        interim_transcript += event.results[i][0].transcript;\n      }\n    }\n\n    instance.publishState(\"transcript\", final_transcript);\n    instance.triggerEvent(\"new_utterance\");\n  };\n}"}},"AAk":{"caption":"Stop recognition","code":{"fn":"function(instance, properties, context) {\n  if (!instance.data.recognition) {\n    context.reportDebugger(\"Couldn't stop recognition, not supported\");\n    return;\n  }\n\n  instance.data.recognition.stop();\n}"}}},"code":{"initialize":{"fn":"function(instance, context) {\n  $(document).ready(function () {\n    if (!(\"webkitSpeechRecognition\" in window)) {\n      return;\n    }\n\n    const recognition = new window.webkitSpeechRecognition();\n    recognition.continuous = true;\n    recognition.interimResults = true;\n\n    recognition.onstart = function () {\n      instance.publishState(\"is_listening\", true);\n      instance.data.isListening = true;\n    };\n\n    recognition.onend = function () {\n      instance.publishState(\"is_listening\", false);\n      instance.data.isListening = false;\n    };\n\n    recognition.onerror = function (event) {\n      instance.publishState(\"is_listening\", false);\n      instance.data.isListening = false;\n      context.reportDebugger(\"Error in webSpeech speech recognition: \" + JSON.stringify(event.error));\n    };\n\n    recognition.onsoundstart = function () {\n      instance.publishState(\"sound_happening\", true);\n    };\n\n    recognition.onsoundend = function () {\n      instance.publishState(\"sound_happening\", false);\n    };\n\n    instance.data.recognition = recognition;\n  });\n}"},"update":{"fn":"function(instance, properties) {\n  instance.data.language = properties.language;\n  instance.data.continuous = properties.continuous;\n  instance.data.keepFull = properties.keep_full_transcript;\n  instance.data.period = properties.period;\n  instance.data.capitalize = properties.capitalize;\n}"},"reset":{"fn":"function(instance, context) {\n\n\n\n}"}}}}};
